import React from "react";
import { NavLink } from "react-router-dom";
import "./navBarLinks.css";

const SignedUserOutLinks = () => {
  return (
    <div>
      <ul className="right">
        <li className="isa_links">
          <NavLink to="/pocetna">Prijavi se</NavLink>
        </li>
        <li className="isa_links">
          <NavLink to="/pocetna">Registruj se</NavLink>
        </li>
      </ul>
    </div>
  );
};

export default SignedUserOutLinks;
